import React from 'react'
import "./style.scss";

export default function Skills() {
    return (
        <div className="skill" data-scroll-section>
            
            <h2> Skills</h2>
            <div>
                <h2>Programming</h2>
                <li/> Python
                <li/> C++
            </div>

            <div>Web Development</div>
            <div>Machine Learning</div>
        </div>
    )
}
